<!DOCTYPE html>

<!-- Created with Ai->Canvas Export Plug-In Version 1.3 (Mac)   -->
<!-- By Mike Swanson (http://blog.mikeswanson.com/)             -->

<html lang="en">
 <head>
  <meta charset="UTF-8" />
  <title>A</title>
  <script>

    function init() {

      var canvas = document.getElementById("canvas");
      var ctx = canvas.getContext("2d");

      draw(ctx);
    }

    function draw(ctx) {

      // layer1/Group
      ctx.save();

      // layer1/Group/Compound Path
      ctx.save();
      ctx.beginPath();

      // layer1/Group/Compound Path/Path
      ctx.moveTo(15.0, 0.0);
      ctx.lineTo(15.0, 19.6);
      ctx.lineTo(8.6, 19.6);
      ctx.lineTo(8.6, 14.4);
      ctx.lineTo(6.4, 14.4);
      ctx.lineTo(6.4, 19.6);
      ctx.lineTo(0.0, 19.6);
      ctx.lineTo(0.0, 0.0);
      ctx.lineTo(15.0, 0.0);
      ctx.closePath();

      // layer1/Group/Compound Path/Path
      ctx.moveTo(6.5, 9.6);
      ctx.lineTo(8.5, 9.6);
      ctx.lineTo(8.5, 4.6);
      ctx.lineTo(6.5, 4.6);
      ctx.lineTo(6.5, 9.6);
      ctx.closePath();
      ctx.fill();
      ctx.restore();
      ctx.restore();
    }
  </script>
 </head>
 <body onload="init()">
   <canvas id="canvas" width="15" height="20"></canvas>
 </body>
</html>
